import React from "react";
import { TouchableOpacity } from "react-native";

import { Feather, MaterialIcons } from "@expo/vector-icons";

import styles from "./style";

const IconTouchable = ({
  name,
  color,
  size,
  aditionalStyle,
  onPress,
  family,
  ...props
}) => {
  if (!name || !color || !size || !onPress) return <></>;

  switch (family) {
    case "MaterialIcons":
      return (
        <TouchableOpacity
          onPress={onPress}
          style={[
            styles.touchableItem,
            { width: size + 5, height: size + 5 },
            aditionalStyle || null,
          ]}
        >
          <MaterialIcons
            style={styles.iconstyle}
            name={name}
            size={size}
            color={color}
          />
        </TouchableOpacity>
      );
      break;

    default:
      return (
        <TouchableOpacity
          onPress={onPress}
          style={[
            styles.touchableItem,
            { width: size + 5, height: size + 5 },
            aditionalStyle || null,
          ]}
        >
          <Feather
            style={styles.iconstyle}
            name={name}
            size={size}
            color={color}
          />
        </TouchableOpacity>
      );
      break;
  }
};

export default IconTouchable;
